import pic from '../../../images/v640-peipei-16-modernbg.jpg'


const ItemCard = () => {
    return ( 
        <Container className={classes.container}>
            <Card>

                <CardMedia 
                    component='img'
                    className={classes.pic}
                    image={pic}
                    title="The picture"
                />
                <CardContent>
                <Typography align="left" color="primary" variant='h5'>Leks Lundary</Typography>
                <Typography variant='h6' color='textSecondary'>Double drawn human hair</Typography>
                <Typography variant='h5' >8,000.00</Typography>
                </CardContent>
                <CardActions>

                </CardActions>
            </Card>
        </Container>
     );
}

export default ItemCard;
